CREATE PROCEDURE [dbo].[AddNewCategory]
	@Name VARCHAR(50),
	@Image VARCHAR(50)
AS
BEGIN
	INSERT INTO Categories(CategoryName, Image) VALUES (@Name, @Image)
END
GO
/****** Object:  UserDefinedFunction [dbo].[fn_Amount]    Script Date: 12/27/2013 14:39:17 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [dbo].[fn_Amount]
(
	@UnitPrice FLOAT,
	@Quantity INT,
	@Discount FLOAT
)
RETURNS FLOAT
AS
BEGIN
	RETURN @UnitPrice*@Quantity*(1-@Discount)

END
GO
/****** Object:  StoredProcedure [dbo].[sp_UpdateCategoryName]    Script Date: 12/27/2013 14:39:14 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[sp_UpdateCategoryName]
(
@ID INT,
@Name VARCHAR(50),
@MinID INT OUTPUT
)
AS
BEGIN
	UPDATE Categories SET CategoryName=@Name WHERE CategoryID=@ID;
	SELECT @MinID=MIN(CategoryID) FROM Categories;
END
GO
/****** Object:  StoredProcedure [dbo].[SearchCategories]    Script Date: 12/27/2013 14:39:14 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[SearchCategories] 
	@Name NVARCHAR(50)
AS
BEGIN
	SELECT * FROM Categories WHERE CategoryName LIKE '%'+@Name+'%'
END
GO
/****** Object:  StoredProcedure [dbo].[sp_SearchProductByPrice]    Script Date: 12/27/2013 14:39:14 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[sp_SearchProductByPrice] 
(
@MinPrice FLOAT,
@MaxPrice FLOAT
)
AS
BEGIN
	SELECT * FROM Products WHERE UnitPrice BETWEEN @MinPrice AND @MaxPrice
END
